import { useState } from "react";
import "./app.css";

function App() {
  const [questionNumber,setQuestionNumber]=useState(1);
  const moneyPyramid=[
    {id:1,amount:"₹ 1000"},
    {id:2,amount:"₹ 2000"},
    {id:3,amount:"₹ 5000"},
    {id:4,amount:"₹ 10,000"},
    {id:5,amount:"₹ 20,000"},
    {id:6,amount:"₹ 50,000"},
    {id:7,amount:"₹ 1,00,000"},
    {id:8,amount:"₹ 2,00,000"},
    {id:9,amount:"₹ 3,60,000"},
    {id:10,amount:"₹ 5,00,000"},
    {id:11,amount:"₹ 10,00,000"},
    {id:12,amount:"₹ 25,00,000"},
    {id:13,amount:"₹ 50,00,000"},
    {id:14,amount:"₹ 75,00,000"},
    {id:15,amount:"₹ 1,00,00,000"}
  ].reverse();
  return (
    <div className="app">
      <div className="main">main</div>
      <div className="pyramid">
        <ul className="moneyList">
         {moneyPyramid.map((m)=>(
          <li className={questionNumber===m.id}>
          <span className="moneyListItemNumber">{m.id}</span>
          <span className="moneyListItemAmount">{m.amount}</span>
       </li>
         ))}
        </ul>
      </div>
    </div>
  );
}

export default App;
